<div class="entities" style="line-height: 2.5; direction: ltr">Microglial activation , increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and P31645 expression in the prefrontal cortex define stress-altered behaviour in mice susceptible to anhedonia . A chronic stress paradigm comprising exposure to predation , tail suspension and restraint induces a depressive syndrome in C57BL / 6J mice that occurs in some , but not all , animals . Here , we sought to extend our behavioural studies to investigate how susceptibility ( sucrose preference &lt; 65 % ) or resilience ( sucrose preference &gt; 65 % ) to stress-induced anhedonia affects the 5HT system and the expression of inflammation-related genes . All chronically stressed animals , displayed increased level of anxiety , but susceptible mice exhibited an increased propensity to float in the forced swim test and demonstrate hyperactivity under stressful lighting conditions . These changes were not present in resilient or acutely stressed animals . Compared to resilient animals , susceptible mice showed elevated expression of tumour necrosis factor alpha ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) and the 5 - HT transporter ( P31645 ) in the pre-frontal area . Enhanced expression of 5HT ( 2A ) and

</mark>
 in the pre-frontal area was observed in all stressed animals . In turn , indoleamine -2,3- dioxygenase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) was significantly unregulated in the raphe of susceptible animals . At the cellular level , increased numbers of Iba - 1 - positive microglial cells were also present in the prefrontal area of susceptible animals compared to resilient animals . Consequently , the susceptible animals display a unique molecular profile when compared to resilient , but anxious , animals . Unexpectedly , this altered profile provides a rationale for exploring anti-inflammatory , and possibly ,

 - targeted therapy for major depression .</div>

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00991
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 : kinetic and dynamic profile in the treatment of pain . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00991
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ( 4,5- diphenyl - 2 - oxazolepropionic acid ) is a non-steroidal anti-inflammatory drug ( NSAID ) which is effective in models of inflammation , pain and pyrexia . It is effective and well tolerated in the clinical management of adult rheumatoid arthritis ( RA ) , osteoarthritis ( OA ) , ankylosing spondylitis , soft tissue disorders and post operative dental pain . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00991
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 has a high oral bioavailability ( 95 % ) , with peak plasma concentrations at 3 to 5 hours after dosing . It is metabolised in the liver by oxidative and conjugative pathways and readily eliminated by the renal and faecal routes . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00991
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 ' s strong analgesic qualities are particularly useful in painful musculoskeletal conditions such as periarthritis of the shoulder , since it exhibits actions such as inhibition of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P23219
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 isoenzymes , inhibition of nuclear translocation of NF-kappaB and of metalloproteases , and modulates the endogenous cannabinoid system . This editorial addresses the accompanying paper by Barbara Heller and Rosanna Tarricone on the management of shoulder periarthritis pain , in which they studied the efficacy and safety of oxaprozin compared to the comparator drug diclofenac over a 15 day period . Both oxaprozin and diclofenac compared well in the primary study endpoint of reduction in shoulder pain . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00991
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 and diclofenac were well tolerated and oxaprozin showed better improvement in shoulder function and in the mental health item of the SF - 36 quality of life component . The study by Heller and Tarricone is an addition to the large number of clinical trials which demonstrate that oxaprozin has equal efficacy in comparison with standard doses of commonly used anti-rheumatic agents such as aspirin , diclofenac , ibuprofen , indomethacin etc . in several different painful musculoskeletal conditions .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Antihistamine effects on prefrontal cortex activity during working memory process in preschool children : a near-infrared spectroscopy ( NIRS ) study . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35367

</mark>
 antagonists ( antihistamines ) are widely used for the treatment of allergic disorders in young children . This study examined the effects of antihistamine on prefrontal cortex activity in preschool children using near-infrared spectroscopy ( NIRS ) , an emerging brain-imaging method suitable for psychological experiments , especially in young children . We examined the changes of oxygenated hemoglobin concentration in the prefrontal cortex while children performed a spatial working memory task , 3h after taking a first-generation antihistamine ( ketotifen ) , second-generation antihistamine ( epinastine ) , or placebo . Fifteen healthy preschool children ( mean age , 5.5 years ) participated . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00920

</mark>
 significantly impaired behavioral performance and cortical activation at the lateral prefrontal cortex in the working memory task , compared with epinastine and placebo . There were no sedative effects on neural response or behavioral performance after epinastine administration . This paper demonstrates for the first time differential sedation effects of first - and second-generation antihistamines on brain hemodynamic response in young children . Also discussed is the utility of the NIRS technique in neuropsychopharmacological studies of children .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Genetically rescued tetrahydrobiopterin-depleted mice survive with hyperphenylalaninemia and region-specific monoaminergic abnormalities . One of the possibly mutated genes in DOPA-responsive dystonia ( DRD , Segawa ' s disease ) is the gene encoding

</mark>
 , which is the rate-limiting enzyme for tetrahydrobiopterin ( BH4 ) biosynthesis . Based on our findings on 6 - pyruvoyltetrahydropterin synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q03393

</mark>
 ) gene-disrupted ( Pts ( - / - ) ) mice , we suggested that the amount of tyrosine hydroxylase ( TH ) protein in dopaminergic nerve terminals is regulated by the intracellular concentration of BH4 . In this present work , we rescued Pts ( - / - ) mice by transgenic introduction of human 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q03393

 cDNA under the control of the dopamine beta-hydroxylase promoter to examine regional differences in the sensitivity of dopaminergic neurons to BH4 - insufficiency . The DPS-rescued ( Pts ( - / - ) , DPS ) mice showed severe hyperphenylalaninemia . Human 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 was efficiently expressed in noradrenergic regions but only in a small number of dopaminergic neurons .

 and dopamine contents , and TH activity in the striatum were poorly restored compared with those in the midbrain . TH-immunoreactivity in the lateral region of the striatum was far weaker than that in the medial region or in the nucleus accumbens . We concluded that dopaminergic nerve terminals projecting to the lateral region of the striatum are the most sensitive to BH4 - insufficiency . Biochemical and pathological changes in DPS-rescued mice were similar to those in human malignant hyperphenylalaninemia and DRD .</div>

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Enhanced uridine adenosine tetraphosphate-induced contraction in renal artery from type 2 diabetic Goto-Kakizaki rats due to activated cyclooxygenase / thromboxane receptor axis . The dinucleotide uridine adenosine tetraphosphate ( Up4A ) , which has both purine and pyrimidine moieties , was reported as a novel endothelium-derived contracting factor . Recently , growing evidence has suggested that Up4A plays an important role in regulation of the cardiovascular function . We previously demonstrated that Up4A - induced vasoconstrictions are altered in arteries from DOCA-salt hypertensive rats . We have assessed responses to Up4A shown by renal arteries from type 2 diabetic Goto-Kakizaki ( GK ) rats ( 42-46 weeks old ) and identified the molecular mechanisms involved . Concentration-dependent contractions to Up4A were greater in renal arterial rings from the GK than age-matched control Wistar group . In both groups , the inhibition of nitric oxide synthase ( with N ( G ) - nitro-L-arginine ) increased the response to Up4A , whereas the inhibition of cyclooxygenase (

</mark>
 ) ( with indomethacin ) decreased the response . Specific inhibitors of

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( NS398 ) , a thromboxane ( TX ) receptor ( TP ) antagonist ( SQ29548 ) , and P2 receptor antagonist ( suramin ) also decreased the response to Up4A . Protein expressions of COXs in renal arteries were greater in the GK than Wistar group . The production of TXB 2 ( a metabolite of TXA 2 ) by Up4A did not differ between these groups . Concentration-dependent contractions to U46619 , an agonist of the TP receptor , were greater in renal arteries from the GK than Wistar group . The expression of

 receptors did not differ between these groups . These results suggest that enhancement of the Up4A - induced contraction in renal arteries from GK rats may be attributable to the increased activation of COXs / TP receptor signaling .</div>

 and FcepsilonRIalpha promoter polymorphisms , may contribute to the pathogenesis of aspirin-induced urticaria / angioedema . Further investigation to identify candidate genetic markers would help to elucidate the pathogenic mechanism of this condition .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Protein kinase C-associated kinase regulates NF-κB activation through inducing IKK activation . Activation of the transcription factor NF-κB induced by extracellular stimuli requires IKKα and IKKβ kinase activity . How IKKα and IKKβ are activated by various upstream signaling molecules is not fully understood . We previously showed that protein kinase C-associated kinase (

</mark>
 , also known as P57078 / RIP 4 ) , which belongs to the receptor-interacting protein ( RIP ) kinase family , mediates the B cell activating factor of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 family ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) - induced NF-κB activation in diffuse large B cell lymphoma ( DLBCL ) cell lines . Here we have investigated the mechanism underlying NF-κB activation regulated by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P03952

</mark>
 . Our results suggest that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 can activate both the classical and the alternative NF-κB activation pathways . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 associates with IKKα and IKKβ in mammalian cells and induces activation of both IKKα and IKKβ via phosphorylation of their serine residues 176/180 and 177/181 , respectively . Unlike other members of the RIP family that activate NF-κB through a kinase-independent pathway , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 appears to activate IKK and NF-κB mainly in a kinase-dependent manner . Suppression of

 expression by RNA interference inhibits phosphorylation of IKKα and IKKβ as well as activation of NF-κB in human cancer cell lines . Thus ,

 regulates NF-κB activation by modulating activation of IKKα and IKKβ in mammalian cells . We propose that

 may provide a critical link between IKK activation and various upstream signaling cascades , and may represent a potential target for inhibiting abnormal NF-κB activation in human cancers .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Ca2 + response of rat mesangial cells to DB00171 analogues . The aim of this investigation was to characterise the effects of DB00171 analogues and UTP on the single cell intracellular Ca2 + concentration ( [ Ca2 + ] i ) in cultured rat mesangial cells . Typically , there were two phases in the Ca2 + response to the agonists , an initial fast transient peak and a subsequent slower decline , or plateau , phase . For the peak amplitude in [ Ca2 + ] i the agonists had about equal effect . But when taking in consideration the percentage of responding cells and the integrated Ca2 + response over 1 min , the order of efficacy of nucleotide agonists ( 100 microM ) was UTP = DB00171 &gt; ATPgammaS &gt; ADP = 2MeS - DB00171 ( 2 - methylthio - DB00171 ) . DB00640 , AMP and beta , gamma-Me - DB00171 ( 100 microM ) had no effect .

 ( 100 microM ) and reactive blue ( 50 microM ) decreased the number of responding cells . Removing Ca2 + from the bath diminished neither the peak in [ Ca2 + ] i nor the percentage of responding cells , but the average [ Ca2 + ] i increase in 1 min was significantly reduced . The results indicate that

 receptors are present in rat mesangial cells but it can not be excluded that there are receptors distinct from

<h2 style="margin: 0">17</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The L-arginine paradox : Importance of the L-arginine / asymmetrical dimethylarginine ratio . Cardiovascular diseases ( CVD ) are still the most frequent cause of death in Western Europe . Pathophysiological experiments revealed in the last years that the vascular endothelium , as well as a result of the synthesis of nitric oxide ( NO ) , is a crucial regulator of vascular function and homeostasis . The vascular endothelium plays a key role in cardiovascular physiology and pathophysiology , largely via NO-dependent processes . L - 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00125
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is the substrate for the endothelial NO synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) to generate NO . Endothelial dysfunction is caused by various cardiovascular risk factors . In most studies , acute and chronic administration of L-arginine has been shown to improve endothelial function in animal models of hypercholesterolemia and atherosclerosis . Therefore , numerous studies have been conducted to elucidate whether dietary L-arginine supplementation can augment NO production in humans and thereby improve endothelium-dependent vasodilatation . The most likely mechanism that explains the occurrence of endothelial dysfunction and the effect of L-arginine is that application of L-arginine antagonizes asymmetric dimethylarginine ( DB01686 ) , the endogenous NO synthase ( NOS ) inhibitor . This could solve the L-arginine paradox namely that L-arginine improves NO-mediated vascular function in vivo , although its baseline plasma concentration is about 25 - to 30 - fold higher than the Michaelis-Menten constant Km of the isolated , purified 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 in vitro . Recent findings suggest that large , prospective , randomized clinical trials might be needed to identify those patients who are the most likely to benefit from L-arginine . Testing patients for DB01686 and L-arginine plasma levels for calculating the L-arginine / DB01686 ratio might be an adequate strategy .</div>
